# OEIS sequence: A359536

from networkx import empty_graph, find_cliques
from itertools import combinations
def A359536(n):
    def is_not_power_of_two(n): return bool((n&-n)^n) if n else True
    v = [e for e in list(range(n+1)) if is_not_power_of_two(2*e)]
    G = empty_graph(v)
    G.add_edges_from((a,b) for a, b in combinations(v,2) if is_not_power_of_two(a+b))
    return max(len(c) for c in find_cliques(G)) # _Chai Wah Wu_, Jan 09 2026

